INSERT INTO `state_info` (`id`, `state_id`, `data`) VALUES (1,35,'Enabling Act of 1802, authorizing residents of the eastern portion of the Northwest Territory to form the state of Ohio.'),(2,25,'Missouri Compromise, 1820 federal statute enabling the admission of Missouri (a slave state) and Maine (a free state) into the Union.'),(3,19,'Missouri Compromise, 1820 federal statute enabling the admission of Missouri (a slave state) and Maine (a free state) into the Union.'),(4,22,'Toledo War, 1835–36 boundary dispute between Ohio and the adjoining Michigan Territory, which delayed Michigan\'s admission to the Union.'),(5,43,'Texas annexation, the 1845 incorporation of the Republic of Texas into the United States as a state in the Union.'),(6,5,'Compromise of 1850, a package of congressional acts, one of which provided for the admission of California to the Union.'),(7,16,'Bleeding Kansas, a series of violent conflicts in Kansas Territory involving anti-slavery and pro-slavery factions in the years preceding Kansas statehood, 1854–61.'),(8,34,'Enabling Act of 1889, authorizing residents of Dakota, Montana, and Washington territories to form state governments (Dakota to be divided into two states) and to gain admission to the Union.'),(9,41,'Enabling Act of 1889, authorizing residents of Dakota, Montana, and Washington territories to form state governments (Dakota to be divided into two states) and to gain admission to the Union.'),(10,26,'Enabling Act of 1889, authorizing residents of Dakota, Montana, and Washington territories to form state governments (Dakota to be divided into two states) and to gain admission to the Union.'),(11,47,'Enabling Act of 1889, authorizing residents of Dakota, Montana, and Washington territories to form state governments (Dakota to be divided into two states) and to gain admission to the Union.'),(12,3,'Enabling Act of 1906 authorizing residents of Oklahoma, Indian, New Mexico, and Arizona territories to form state governments (Indian and Oklahoma territories to be combined into one state) and to gain admission to the Union.'),(13,31,'Enabling Act of 1906 authorizing residents of Oklahoma, Indian, New Mexico, and Arizona territories to form state governments (Indian and Oklahoma territories to be combined into one state) and to gain admission to the Union.'),(14,36,'Enabling Act of 1906 authorizing residents of Oklahoma, Indian, New Mexico, and Arizona territories to form state governments (Indian and Oklahoma territories to be combined into one state) and to gain admission to the Union.'),(15,2,'Alaska Statehood Act, admitting Alaska as a state in the Union as of January 3, 1959.'),(16,11,'Hawaii Admission Act, admitting Hawaii as a state in the Union as of August 21, 1959.');
